import React from 'react';
import { Routes, Route } from 'react-router-dom'
import './App.css';
import Home from './pages/Home'

function App() {
  return (
      // <div className="App">

      // </div>
      <Routes>
          <Route path='/' element={<Home/>}/>
        </Routes>
  );
}

export default App;
